import { Link } from 'react-router-dom';
import '../App.css';
import   'react-bootstrap/Navbar';
import  'react-bootstrap/Nav';

const Navbar = () => (
  <nav>
    <ul>
      <li><Link to="/">Home</Link></li>
      <li><Link to="/add">Adicionar Greve</Link></li>
    </ul>
  </nav>
);

export default Navbar;
